Teaser:
Kør dine C/C++-programmer i ChATGPT ved hjælp af denne prompt. Dette er en meget kraftfuld prompt til at køre alle slags kodningssprog direkte i din webbrowser ved hjælp af Chatgpt.

 Indtast blot din C- eller C++-kode, du vil køre i prompten, og Chat-GPT vil give dig output fra det pågældende program som svar.

 Dette er nyttigt, hvis du ikke har compiler installeret på din pc og vil teste noget kode, nu kan du gøre det ved en simpel prompt.

 Eksempel på C++-kode.
 #include <Istream>

 int main() {
  std::cout << "Hej chat-gpt3" << std::endl;
  returnere 0;
 }
